  false,\n\t\"url\": null,\n\t\"notes\": \"Ocean wave property data collected from
  the SAIL Pitch-roll Buoy as partnof the 1974 Atlantic Tropical Experiment (GATE)
  project that was part ofnthe Global Atmospheric Research Program (GARP). Data were
  submitted bynMr. William McLeish from NOAA/AOML/SAIL. Parameters include wavenelevation
  and direction. The calculation of nominally 34-minute runsnemployed a procedure
  based on that of Dr. J. Ewing of IOS. Thendocumentation includes the data in columnar
  format and plots of thendata. The Ocean wave data was collected from R/V GILLISS
  during GATEn1974.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
